    "2015-02-03T21:06:29.416737",nt"name": "contours-offshore-of-san-francisco-california",nt"isopen":
    false,nt"url": null,nt"notes": "This part of DS 781 presents data for the
    bathymetric contours for several seafloor maps of the Offshore of San Francisco
    map area, California. The vector data file is included in "Contours_OffshoreSanFrancisco.zip,"
    which is accessible from http://pubs.usgs.gov/ds/781/OffshoreSanFrancisco/data_catalog_OffshoreSanFrancisco.html.
    10-m interval contours of the Offshore of San Francisco map area, California, were
    generated from bathymetry data collected by Fugro Pelagos and by California State
    University, Monterey Bay, Seafloor Mapping Lab (CSUMB). Mapping was completed between
    2004 and 2008, using a combination of 400-kHz Reson 7125 and 244-kHz Reson 8101
    multibeam echosounders. These mapping missions combined to collect bathymetry from
    about the 10-m isobath to beyond the 3-nautical-mile limit of California's State
    Waters. Bathymetric contours at 10-m intervals were generated from the merged 2-m
    bathymetric surface. The most continuous contour segments were preserved while smaller
    segments and isolated island polygons were excluded from the final output. Contours
    were smoothed via a polynomial approximation with exponential kernel (PAEK) algorithm
    using a tolerance value of 60 m. The contours were then clipped to the boundary
    of the map area. These data are not intended for navigational purposes.",nt"license_title":
